css:
.nuclide-ssh-tunnels-panel-contents {
  flex: 1;
  padding: 0.5em;
}
.nuclide-ssh-tunnels-table-row {
  margin-top: 0.3em;
  margin-bottom: 0.3em;
}
.nuclide-ssh-tunnels-table-empty-message {
  margin-top: 1em;
  margin-bottom: 1em;
  display: flex;
  justify-content: center;
}
.nuclide-ssh-tunnels-manual-tunnel-section {
  padding: 1.2em;
  border-radius: 2px;
  border: 1px solid rgba(0, 0, 0, 0.5);
  display: flex;
  flex-direction: column;
  justify-content: center;
}
.nuclide-ssh-tunnels-manual-tunnel-section-row {
  display: flex;
  justify-content: space-between;
}
.nuclide-ssh-tunnels-manual-tunnel-section-row > * {
  margin: 0.5em;
  display: inline-flex;
}
.nuclide-ssh-tunnels-manual-tunnel-section-row :first-child {
  margin-left: 0em;
}
.nuclide-ssh-tunnels-manual-tunnel-section-row :last-child {
  margin-right: 0em;
}
.nuclide-ssh-tunnels-manual-tunnel-section-host-field {
  align-self: center;
}
.nuclide-ssh-tunnels-manual-tunnel-section-description {
  flex-grow: 1;
}
